import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Click on "Your Profile" link (first visible occurrence)
    const profileLink = await page.locator('a', { hasText: 'Your Profile' }).first();
    await profileLink.waitFor({ state: 'visible', timeout: 5000 });
    await profileLink.click();

    // Wait for profile page to load (look for Jun's profile image and full name)
    await page.waitForSelector('.profile-header img.profile-image', { timeout: 5000 });
    await page.waitForSelector('.profile-info h2', { timeout: 5000 });

    // Take screenshot of profile page
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_profile_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_profile_page.png'));

    // Extract profile information
    const extractedData = {};

    // Full Name
    extractedData.fullName = await page.locator('.profile-info h2').textContent();

    // Username
    extractedData.username = await page.locator('.profile-info .username').textContent();

    // Bio
    extractedData.bio = await page.locator('.profile-info .bio').textContent();

    // Profile Image URL
    extractedData.profileImage = await page.locator('.profile-header img.profile-image').getAttribute('src');

    // Stats
    const statNumbers = await page.locator('.profile-stats .stat-number').allTextContents();
    const statLabels = await page.locator('.profile-stats .stat-label').allTextContents();
    for (let i = 0; i < statLabels.length; i++) {
      const label = statLabels[i].toLowerCase().replace(/[^a-z]/g, '');
      extractedData[label] = statNumbers[i];
    }

    // Products by Jun (titles)
    extractedData.productsByJun = await page.locator('.profile-sections .section:nth-of-type(1) .product-title').allTextContents();

    // Jun's Recent Reviews (extract product, title, rating, date)
    const reviews = [];
    const reviewItems = await page.locator('.profile-sections .section:nth-of-type(2) .review-item');
    const reviewCount = await reviewItems.count();
    for (let i = 0; i < reviewCount; i++) {
      const item = reviewItems.nth(i);
      const product = await item.locator('.review-product-title').textContent();
      const title = await item.locator('.review-title').textContent();
      const ratingStars = await item.locator('.stars').textContent();
      const date = await item.locator('.review-date').textContent();
      reviews.push({
        product: product?.trim(),
        reviewTitle: title?.replace(/["']/g, '').trim(),
        ratingStars: ratingStars?.trim(),
        date: date?.trim()
      });
    }
    extractedData.recentReviews = reviews;

    // Take screenshot of reviews section
    const reviewsSection = await page.locator('.profile-sections .section:nth-of-type(2)');
    if (await reviewsSection.count()) {
      await reviewsSection.screenshot({ path: path.join(screenshotsDir, 'step_3_reviews_section.png') });
      screenshots.push(path.join(screenshotsDir, 'step_3_reviews_section.png'));
    }

    return {
      success: true,
      action: "Harvested user profile information including name, username, bio, stats, Jun's products, and recent reviews.",
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
